People want to like, trust, and know you before they purchase from you. The marketing sales funnel represents the path someone takes from learning about your product, service or business to making a purchase.

It goes a little something like this:

‚¨áÔ∏èAwareness

You want to drive awareness to people about your business, what you have to offer, what makes you different from your competitors, and why they should purchase from you.
‚†Ä
‚¨áÔ∏èConsideration

Those in the consideration phase will be introduced to your product/services and will take an action such as become a fan/follower and visit your website.
‚†Ä
‚¨áÔ∏èPurchase

They will then decide if they want to purchase from you. You want to entice the purchase by staying top of mind and offering an incentive.
‚†Ä
‚¨áÔ∏èLoyalty

Those in this stage of the funnel will continue to buy from you and recommend you to others.

